import { AppBar, Box, Toolbar } from '@mui/material';
// sx={{}}
const Header = () => {
  return (
    <>
      <AppBar sx={{ position: 'sticky', width: '100%' }}>
        <Toolbar sx={{ display: 'flex', justifyContent: 'space-between' }}>
          <Box sx={{ flex: 1 }}>Logo</Box>
          <Box sx={{ flex: 1 }}>
            <ul sx={{ display: 'flex' }}>
              <li>trending</li>
              <li>movies</li>
              <li>series</li>
              <li>search</li>
            </ul>
          </Box>

          <Box sx={{ flex: 1 }}>menubar</Box>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
